        tipy += 96;

        strokerect(ctx, '#000000', 1, tipx - tipw / 2, tipy - tiph / 2, tipw, tiph);
        fillrect(ctx, '#FFFFFF', tipx - tipw / 2, tipy - tiph / 2, tipw, tiph);
        tipy += 18 - tiph / 2;
